// Console.js
import React, { useState } from 'react';

const Console = () => {
  const [activeTab, setActiveTab] = useState('Console');
  const [consoleInput, setConsoleInput] = useState('');
  const [consoleOutput, setConsoleOutput] = useState([]);

  const handleConsoleInput = (e) => {
    setConsoleInput(e.target.value);
  };

  const handleConsoleSubmit = () => {
    // Process the consoleInput (e.g., execute a command)
    // For this example, let's just echo the input
    setConsoleOutput([...consoleOutput, `> ${consoleInput}`]);
    setConsoleInput('');
  };
  const a = "dsdsd"

  const tabs = ['Console', 'Elements', 'Network', 'Sources', 'Performance'];

  return (
    <div className="flex flex-col">
      <div className="p-2 bg-gray-100">
        <div className="flex">
          {tabs.map((tab) => (
            <button
              key={tab}
              className={`px-4 py-2 ${
                activeTab === tab
                  ? 'bg-gray-300'
                  : ' hover:bg-gray-300'
              }`}

            >
              {tab}
            </button>
          ))}
        </div>
      </div>
      <div className=" ">
        {activeTab === 'Console' && (
          <>
          <div >
          <div>
          <span >{'>'} Shubhada.origin</span>
          </div>
          <span className='text-blue-500'> {'->'} "Pune, India"</span>
          <br/>
          <div>
          <span>{'>'} Shubhada.education</span>
          </div>
          <span className='text-blue-500'> {'->'} "Syracuse University"</span>
          <div>
          <span>{'>'} Shubhada.major</span>
          </div>
          <span className='text-blue-500'> {'->'} "Computer Science"</span>
          <div>
          <span>{'>'} Shubhada.workExperience.latest</span>
          </div>
          <span className='text-blue-500'> {'->'} "TruWeather Solutions Inc." <p> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; "Software Engineer" </p></span>
          </div>
          </>
        )}
        {/* Render other tab content here */}
      </div>
    </div>
  );
};

export default Console;
